import React from "react";
import CardBtn from "../CardBtn";
import "./style.css";

function ButtonContainer(props) {
  return (
    <div className="position-relative">
      <CardBtn
        onClick={props.handleBtnClick}
        data-value="Name"
      />
      <CardBtn
        onClick={props.handleBtnClick}
        data-value="Location"
      />
    </div>
  );
}

export default ButtonContainer;
